import React, {useState} from 'react';

import { Text, View, Image } from 'react-native';

function KatsItem ({preview, names, id}) {

	const [collection, setCollection] = useState([])


let katName = names.map((name, index) => 
	<Text key={index}>
		{name}	
	</Text>
	)

	return (
		<View key={id}>
		{
			collection.map((item, index) => (
				<View key={index}>
					<Image
			          	source={{
			            width: 200,
			            height: 200,
			            uri: preview
			        }}
			          />
			          {katName}	
				</View>

				))
		}	         
	</View>		
	)
}

export default KatsItem;
